export const styles = theme => ({
    landingsearchform: {
        display: "contents",
    },
    landingsearchwrapper: {
        paddingTop: 32,
    },
    landingsearchlabel: {
        textAlign: "center",
        display: "block",
        marginTop: 13,
    },
    searchsubmitbtn: {
        minWidth: 250,
        float: "right",
        marginTop: 28,
        fontSize: 16,
        textTransform: "uppercase"
    }
});
